ISLAMABAD, Mar 25 (APP):Wafaqi Mohtasib (Federal Ombudsman) Ejaz Ahmed Qureshi on Tuesday called on President, Asif Ali Zardari here and presented the annual performance report 2024.
According to the report, the Federal Ombudsman received record 226,000 complaints in 2024 which is 17 percent more than the year 2023.
